import React from "react";
import { Link } from "react-router-dom";

const Login = () => {
  return (
    <div className="ui container">
      <Link to="/dashboard">
        <button ui primary button>
          Login here!
        </button>
      </Link>
    </div>
  );
};

export default Login;
